// Landing Clients ------------------------------------
// -----  Animation
.Landing_Clients {
    width: 100%;
    margin: 130px 0;
    margin-bottom: 60px;
    // opacity: 0;
    transition: opacity .4s ease-in;
}

    .Landing_Clients-Wrap {
        width: 100%;
        position: relative;
    }

        .Landing_Clients-Title {
        }

        .Landing_Clients-ImageWrap {
            width: 100%;
            padding-top: 50px;
        }

        .Landing_Clients-Row {
            width: 100%;
            height: 12vw;
            max-height: 250px;
            display: flex;
        }
            .Landing_Clients-Row1 {
                border-bottom: 1px solid #c6c6c6;
            }

            .Landing_Clients-Box {
                width: 25%;
                display: flex;
                justify-content: center;
                align-items: center;
                border-right: 1px solid #c6c6c6;
                position: relative;
            }
                .Landing_Clients-Box:last-child {
                    border: none;
                }

                .Landing_Clients-BoxImage {
                    position: absolute;
                    left: 50%;
                    top: 50%;
                    transform: translate(-50%,-50%);
                    filter: grayscale(100%);
                    cursor: pointer;
                }

                    .Landing_Client1 {
                        width: 50%;
                    }
                    .Landing_Client2 {
                        width: 35%;
                    }
                    .Landing_Client3 {
                        width: 40%;
                    }
                    .Landing_Client4 {
                        width: 40%;
                    }
                    .Landing_Client5 {
                        width: 40%;
                    }
                    .Landing_Client6 {
                        width: 50%;
                    }
                    .Landing_Client7 {
                        width: 45%;
                    }
                    .Landing_Client8 {
                        width: 45%;
                    }

@media screen and (max-width: 1100px){
    .Landing_Clients {
        margin: 80px 0px;
    }   
    .Landing_Clients-ImageWrap {
        padding-top: 0;
    }
}

@media screen and (max-width: 900px){
    .Landing_Clients-ImageWrap {
        display: flex;
    }
    .Landing_Clients-Row {
        flex-direction: column;
        width: 50%;
        height: 80vw;
        max-height: 500px;
        border: none;
    }
    .Landing_Clients-Row1 {
        border-right: 1px solid #c6c6c6;
    }
    .Landing_Clients-Box {
        width: 100%;
        height: 300px;
        border: none;
        border-bottom: 1px solid #c6c6c6;
    }
}

