// Landing Case Study ------------------------------------

.Landing_CaseStudies {
    width: 100%;
    margin: 130px 0;
    margin-bottom: 60px;
}

    .Landing_CaseStudies-Wrap {
        width: 100%;
        position: relative;
    }
        //Project
        .Landing_CaseStudy-Project {
            width: 100%;
            height: 44vw;
            max-height: 700px;
            margin-bottom: 160px;
        }

            .Landing_CaseStudy-ProjectWrap {
                width: 100%;
                height: 100%;
                position: relative;
            }

                .Landing_CaseStudy-Project-Cover {
                    position: absolute;
                    left: 0;
                    width: 100%;
                    height: 100%;
                    background-color: #f4f4f4;
                    transition: left .8s ease-in;
                    z-index: 5;
                }


                .Landing_CaseStudy-Card {
                    position: absolute;
                    bottom: 0;
                    left: 0;
                    right: 0;
                    width: 100%;
                    height: calc(100% - 15%);
                    border-radius: 2px;
                    z-index: 1;
                }
                        .CaseStudy-Card1 {
                            background-color: #363535;
                        }
                        .CaseStudy-Card2 {
                            background-color: #444444;
                        }
                        .CaseStudy-Card3 {
                            background-color: rgb(230, 227, 219);
                        }
                        .CaseStudy-Card4 {
                            background-color: #0A0729;
                        }
                        .CaseStudy-Card5 {
                            background-color: #65665B;
                        }

                .Landing_CaseStudy-Text {
                    position: absolute;
                    bottom: 0;
                    left: 0;
                    right: 0;
                    width: 100%;
                    height: calc(100% - 15%);
                    z-index: 2;
                }


                    .Landing_CaseStudy-TextWrap {
                        width: 100%;
                        height: 100%;
                        position: relative;
                        padding: 50px 48px;
                        display: flex;
                        flex-direction: column;
                        justify-content: space-between;
                        color: #FFF;
                    }

                        .Dark-Text {
                        color: #141414;
                    }

                        .Landing_CaseStudy-Image {
                            width: 80px;
                            margin-top: 10px;
                        }

                            .GoDaddy-CardLogo {
                                width: 130px;
                            }
                            .MeetUp-CardLogo {
                                width: 130px;
                            }
                            .Cape-CardLogo {
                                width: 130px;
                            }
                            .Petrolicious-CardLogo {
                                width: 165px;
                            }

                        .Landing_CaseStudy-Description {
                            font-size: 42px;
                            font-weight: 400;
                            width: 50%;
                            max-width: 650px;
                            transition: font-size .4s ease-in; 
                        }

                        .Landing_CaseStudy-Button {
                            width: 150px;
                            display: flex;
                            justify-content: space-between;
                            align-items: center;
                        }

                            .Landing_CaseStudy-Button-Text {
                                font-weight: 500;
                                font-size: 18px;
                            }

                        .Landing_CaseStudy-ProductNote {
                            position: absolute;
                            font-size: 18px;
                            top: 40px;
                            left: calc(100% - 48px);
                            width: 300px;
                            white-space: nowrap;
                            transform-origin: top left;
                            transform: rotate(90deg);
                        }

                .Landing_CaseStudy-PhoneWrap {
                    position: absolute;
                    width: 100%;
                    height: 100%;
                    z-index: 3;
                    cursor: pointer;
                }

                    .Landing_CaseStudy-PhoneImage {
                        width: 450px;
                        position: absolute;
                        right: 90px;
                        top: -20px;
                        transition: all .4s ease-in;
                    }
                        .Shrink-Landing-Phone {
                            width: 400px;
                            top: 0px;
                        }

@media screen and (max-width: 1600px){
    .Landing_CaseStudy-Description {
        font-size: 32px;
    }
    .Landing_CaseStudy-PhoneImage {
        width: 25vw;
        margin-top: 40px;
    }
    .Landing_CaseStudy-ProductNote {
        font-size: 14px;
    }
}

@media screen and (max-width: 1300px){
    .Landing_CaseStudy-TextWrap {
        padding: 35px 30px;
    }
    .Landing_CaseStudy-Description {
        font-size: 24px;
    }
    .Landing_CaseStudy-ProductNote {
        top: 35px;
        left: calc(100% - 30px);
        width: 50%;
    }
}        

@media screen and (max-width: 1100px){
    .Landing_CaseStudy-Project {
        margin-bottom: 80px;
    }
    .Landing_CaseStudy-Description {
        font-size: 18px;
        line-height: 24px;
    }
    .GoDaddy-CardLogo {
        width: 100px;
    }
    .MeetUp-CardLogo {
        width: 100px;
    }
    .Cape-CardLogo {
        width: 100px;
    }
    .Petrolicious-CardLogo {
        width: 130px;
    }

} 

@media screen and (max-width: 900px){
    .Landing_CaseStudy-Project {
        height: 50vw;
    }
    .Landing_CaseStudy-PhoneImage {
        margin-top: 40px;
        width: 27vw;
    }
}

@media screen and (max-width: 800px){
    .Landing_CaseStudy-Project {
        height: 60vw;
    }
    .Landing_CaseStudy-TextWrap {
        padding: 20px 25px;
    }
    .Landing_CaseStudy-ProductNote {
        top: 17px;
        left: calc(100% - 25px);
        font-size: 10px;
    }
    .Landing_CaseStudy-PhoneImage {
        margin-top: 40px;
        right: 70px;
        width: 33vw;
    }
    .Landing_CaseStudy-Description {
        font-size: 14px;
        width: 40%
    }
    .Landing_CaseStudy-Image {
        width: 60px;
    }
    .GoDaddy-CardLogo {
        width: 100px;
    }
    .MeetUp-CardLogo {
        width: 80px;
    }
    .Cape-CardLogo {
        width: 80px;
    }
    .Petrolicious-CardLogo {
        width: 110px;
    }
}

@media screen and (max-width: 550px) {
    .Landing_CaseStudies-Title {
        margin-bottom: 0px;
    }
    .Landing_CaseStudy-Project {
        height: 120vw;
        margin-bottom: 0px;
    }
    .Landing_CaseStudy-Description {
        display: none;
    }
    .Landing_CaseStudy-PhoneImage {
        width: 45vw;
        top: 90px;
        right: 0;
        left: 50%;
        transform: translateX(-50%);
    }
    .Landing_CaseStudy-ProductNote {
        font-size: 16px;
        top: 30px;
    }
}

@media screen and (max-width: 400px) {
    .Landing_CaseStudy-PhoneImage {
        width: 43vw;
    }
}

